const tableValuesGroupsSkills = (tableBody) => {
    return(
        <table>
            <thead>
                <tr>
                    <th>Group skills</th>
                    <th>Estimate</th>
                    <th>Fragment</th>
                    <th>Color</th>
                </tr>
            </thead>
            <tbody>
                {tableBody}
            </tbody>
        </table>
    )
}

export default tableValuesGroupsSkills;
